import { Input } from "@material-tailwind/react";
import { IoSearchOutline } from "react-icons/io5";
import {
  Card,
  CardHeader,
 
} from "@material-tailwind/react";

function SearchHeader() {
  return ( 
    <div className=" flex flex-col prose prose-invert max-w-none">
      <div className="rounded-lg shadow-lg p-5  ">
        <h1 className="text-4xl font-bold mb-3 ">
          What are you looking for?
        </h1>
        <div className="relative flex-1 ">
          <Input
            type="text"
            placeholder="Search"
            className="!h-14 pl-12 bg-white rounded-2xl border !text-gray-6500  shadow-lg ring-4 ring-transparent placeholder:text-gray-500 "
          />
          <IoSearchOutline className="absolute top-4 left-4 text-gray-500 w-6 h-6" />
        </div>
      </div>

 {/* Movie-Card */}

      <div className="flex flex-col gap-1 ">
     <div className="flex gap-2">
     <Card className="w-[45%] md:w-[50%]   p-0 bg-transparent shadow-none">
        <CardHeader
              floated={false}
              shadow={false}
              className="relative h-[14rem] md:h-[14rem] w-[10rem] md:w-[40rem] bg-[url('data:image/jpeg;base64,')] bg-cover bg-center" children={undefined}        />
      </Card>
      
      <Card className="w-[45%] md:w-[50%]   p-0 bg-transparent shadow-none">
        <CardHeader
              floated={false}
              shadow={false}
              className="relative h-[14rem] md:h-[14rem]  w-[10rem] md:w-[40rem] bg-[url('data:image/jpeg;base64,')] bg-cover bg-center" children={undefined}        />
      </Card>
     </div>

     
      <div className="flex gap-2">
      <Card className="w-[100%] p-0 bg-transparent shadow-none">
        <CardHeader
              floated={false}
              shadow={false}
              className="relative h-[14rem]  bg-[url('data:image/jpeg;base64,')] bg-cover bg-center" children={undefined}        />
      </Card>
      
      </div>

    </div>
    </div>
  );
}

export default SearchHeader;
